import React from "react";
import Api from './conapi';
const Contact = () => {
    {
       const Card =(props)=>{
        return (
            <div>
              <h2>{props.name}</h2>
              <img src={props.img} alt="image" />
              <p>{props.tel}</p>
            </div>
          )
        }
    }
  return (
    <div>
      <>
        <Card
        />
      </>
    </div>
  );
};

export default Contact;
